import React from "react";

class WeatherCard extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            temperature : null,
            cloudCover : null,
            humidity : null,
            precipitation : null,
            uvIndex : null,
            visibility : null,
            weatherCode: null
        }
    }

    render() {
        return (
            <div className="WeatherCard">
                <h3>City</h3>
            </div>
        );
    }
}

export default WeatherCard;
